// frontend/src/App.js
import React, {useState, useEffect} from 'react';
import { BrowserRouter, Routes, Route, Link, useNavigate } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import CreatePost from './pages/CreatePost';
import Profile from './pages/Profile';

function Header(){
  const [open,setOpen] = useState(false);
  const user = JSON.parse(localStorage.getItem('user') || 'null');
  const navigate = useNavigate();
  useEffect(()=>{ const onClick = ()=>setOpen(false); window.addEventListener('click', onClick); return ()=>window.removeEventListener('click', onClick); },[]);
  function logout(){ localStorage.removeItem('token'); localStorage.removeItem('user'); navigate('/login'); }
  return (
    <div className="header container">
      <div className="brand">
        <div className="logo">Z</div>
        <div>
          <div style={{fontWeight:700}}>Zidio Blog</div>
          <div style={{fontSize:12,color:'#64748b'}}>Modern blogging platform</div>
        </div>
      </div>
      <div style={{display:'flex',alignItems:'center',gap:12}}>
        <nav className="navlinks">
          <Link to="/" className="navlink">Home</Link>
          <Link to="/create" className="navlink">Create Post</Link>
          <div className="navlink">Categories</div>
        </nav>
        {!user ? (
          <div>
            <Link to="/login" className="navlink">Login</Link>
            <Link to="/register" className="navlink">Register</Link>
          </div>
        ) : (
          <div style={{position:'relative'}} onClick={e=>{ e.stopPropagation(); setOpen(o=>!o); }}>
            <div style={{display:'flex',alignItems:'center',gap:8}}>
              <div style={{fontSize:14,fontWeight:600}}>{user.name}</div>
              <div className="profile-icon">{user.name[0]?.toUpperCase()}</div>
            </div>
            {open && (
              <div className="dropdown">
                <Link to="/profile">My Profile</Link>
                <a onClick={(e)=>{ e.preventDefault(); logout(); }}>Logout</a>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
}

export default function App(){
  return (
    <BrowserRouter>
      <Header />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home/>} />
          <Route path="/login" element={<Login/>} />
          <Route path="/register" element={<Register/>} />
          <Route path="/create" element={<CreatePost/>} />
          <Route path="/profile" element={<Profile/>} />
        </Routes>
      </div>
    </BrowserRouter>
  )
}
